module("Methods (jQuery)",{setup:function(){this.$inputs=$("<input><input>").datepicker().appendTo("#qunit-fixture")},teardown:function(){this.$inputs.each(function(){$.data(this,"datepicker").picker.remove()})}});test("Methods",function(){["show","hide","setValue","place"].forEach($.proxy(function(a,c){var b=this.$inputs.datepicker(c);strictEqual(b,this.$inputs,"is jQuery element");strictEqual(b.length,2,"correct length of jQuery elements")},this))});